import React, { Component } from "react";
import axios from "axios";
// import ImageList from "./ImageList";

const params = `format=json`;

class Api extends Component {
  state = {
    pictures: []
  };

  componentDidMount() {
    function getPhotos(photos) {
      return axios
        .get(
          "https://api.flickr.com/services/rest/?method=flickr.photos.getRecent&api_key=5f0ca9ae5c0961037501f34373524d33&tags=dogs&per_page=10&&nojsoncallback=1"
        )
        .then(({ response }) => response);
    }

    fetch(
      "https://api.flickr.com/services/rest/?method=flickr.photos.getRecent&api_key=5f0ca9ae5c0961037501f34373524d33&tags=dogs&per_page=10&format=json&nojsoncallback=1"
    )
      .then(response => {
        return response.json();
      })
      .then(j => {
        let picArray = j.photos.photo.map(pic => {
          var srcPath =
            "https://farm" +
            pic.farm +
            ".staticflickr.com/" +
            pic.server +
            "/" +
            pic.id +
            "_" +
            pic.secret +
            ".jpg";
          return <img alt="pics" src={srcPath} />;
        });
        this.setState({ pictures: picArray });
      });
  }

  render() {
    return (
      <div>
        {this.state.pictures}
        {/* <ImageList images={this.state.pictures} /> */}
      </div>
    );
  }
}

export default Api;
